css:
@-moz-document domain("tv4play.se") {

body {
    background: rgb(6, 6, 6);
}

/* Headerbackground */
.fhboNz {
    background: rgb(7, 7, 7) none repeat scroll 0% 0%;
}
.jkILcZ {
    text-decoration: none;
    background: rgb(7, 7, 7) none repeat scroll 0% 0%;
    color: rgb(7, 7, 7);
    border: 1px solid rgb(7, 7, 7);
}

.jkILcZ:hover, .jkILcZ:focus, .bpvDLj:hover, .bpvDLj:focus {
    text-decoration: none;
    background: rgb(90, 8, 7) none repeat scroll 0% 0%;
    color: rgb(255, 255, 255);
    border: 1px solid rgb(90, 7, 7);
}

.fmtaEl {
    background-color: rgb(0, 0, 0);
    border-radius: 62px !important;
    border: 1px solid rgb(25, 25, 25);
    color: rgb(55, 55, 55);
}

/* Main */
.hwxhpi {
    background: rgb(5, 5, 5) none repeat;
}

.jKOlKC {
    color: rgb(60, 15, 15);
}

.jEtxRN, .bpvDLj {
    border-radius: 50px;
    display: inline-flex;
    background: rgb(70, 1, 1) none repeat scroll 0% 0%;
    color: rgb(90, 90, 90);
    border: 1px solid rgb(70, 1, 1);
}

.dUIdEU svg path {
    fill: rgb(90, 90, 90);
}

.cfAfZB, .bOyiOy {
    background-color: rgb(6, 6, 6);
}

.hhtOeU, .hXuMJJ, .hXuMJJ::after, .kaDKZc, .kaDKZc::after, .dSTZdF {
    background: rgb(6,6,6);
}

.igUnEP, .faBoJk {
    background: linear-gradient(45deg, rgba(249, 243, 238, 0) 0%, rgba(249, 243, 238, 0) 50%, rgb(7, 7, 7) 100%) repeat scroll 0% 0%, rgba(0, 0, 0, 0) linear-gradient(90deg, rgba(245, 237, 227, 0), rgb(7, 7, 7) 100%) repeat scroll 0% 0%
}

.cvAAxZ {
    background: none;
}

}
